import { Card, CardContent, CardHeader, Typography } from "@material-ui/core"

const ViewItem = () => {
    return ( 
        <div>
            <Card>
                <CardHeader 
                    title="Timeline"
                    subheader="Production"
                />
                <CardContent>
                    <Typography>test</Typography>
                </CardContent>
            </Card>
        </div>
     );
}
 
export default ViewItem;
